import React from 'react';
import Form from './components/Form';
import { Routes ,Route } from 'react-router-dom';

const App = () => {

  return (
    <div className="App">
      <h1>Health Insurance Premium Calculator</h1>
      <Routes>
          <Route exact path="/" element={<Form />}/>
        </Routes>

    </div>
  );
};

export default App;
